class EmailAuthBackend:
    """
    Consolidated authentication backend that supports both Django User and Provider models.
    """

    def _get_user(self, email, user_model='django'):
        """
        Retrieve a user instance by email for the specified model.
        """
        if user_model == 'django':
            try:
                return django_User.objects.get(email=email)
            except django_User.DoesNotExist:
                return None
        elif user_model == 'provider':
            # Provider lookup uses a related User model field `idUser__mail`
            return Provider.objects.filter(idUser__mail__contains=email).first()
        return None

    def authenticate(self, request=None, username=None, password=None, user_model='django'):
        """
        Authenticate a user by email and password for the specified model.
        """
        user = self._get_user(username, user_model)
        if user and check_password(password, user.password):
            return user
        return None

    def auth_email(self, username=None, user_model='django'):
        """
        Retrieve a user instance by email without password verification.
        """
        return self._get_user(username, user_model)


