#! /usr/bin/env python
# encoding: utf-8
# WARNING! Do not edit! http://waf.googlecode.com/git/docs/wafbook/single.html#_obtaining_the_waf_file

import os, shlex, shutil, traceback, errno, sys, stat
from waflib import Utils, Configure, Logs, Options, ConfigSet, Context, Errors, Build, Node

build_dir_override = None
no_climb_commands = ['configure']
default_cmd = "build"

# --------------------------------------------------------------------
# Helper functions for waf_entry_point
# --------------------------------------------------------------------

def _check_version(version):
    """Verify that the script and library versions match."""
    if Context.WAFVERSION != version:
        Logs.error('Waf script %r and library %r do not match (directory %r)' %
                   (version, Context.WAFVERSION, Context.waf_dir))
        sys.exit(1)

def _handle_version_flag(current_directory):
    """Handle the '--version' command line flag."""
    Context.run_dir = current_directory
    ctx = Context.create_context('options')
    ctx.curdir = current_directory
    ctx.parse_args()
    sys.exit(0)

def _determine_no_climb():
    """Determine whether we should stop climbing up the directory tree."""
    no_climb = os.environ.get('NOCLIMB', None)
    if not no_climb:
        for k in no_climb_commands:
            if k in sys.argv:
                no_climb = True
                break
    return no_climb

def _find_run_dir(start_dir, no_climb):
    """
    Search for the run directory by looking for a lock file or a wscript file.
    Returns the directory path or None if not found.
    """
    cur = start_dir
    while cur:
        try:
            lst = os.listdir(cur)
        except OSError:
            # Directory unreadable, stop searching
            break

        # 1. Look for a lock file and try to load it
        if Options.lockfile in lst:
            env = ConfigSet.ConfigSet()
            try:
                env.load(os.path.join(cur, Options.lockfile))
                ino = os.stat(cur)[stat.ST_INO]
            except Exception:
                pass
            else:
                load = False
                for x in [env.run_dir, env.top_dir, env.out_dir]:
                    if Utils.is_win32:
                        if cur == x:
                            load = True
                            break
                    else:
                        try:
                            ino2 = os.stat(x)[stat.ST_INO]
                        except OSError:
                            pass
                        else:
                            if ino == ino2:
                                load = True
                                break
                if load:
                    Context.run_dir = env.run_dir
                    Context.top_dir = env.top_dir
                    Context.out_dir = env.out_dir
                    return cur
                else:
                    Logs.warn('invalid lock file in %s' % cur)

        # 2. If no lock file, look for a wscript file
        if not Context.run_dir and Context.WSCRIPT_FILE in lst:
            Context.run_dir = cur

        # 3. Move up one directory unless we are at the root or no_climb is set
        next_dir = os.path.dirname(cur)
        if next_dir == cur:
            break
        cur = next_dir
        if no_climb:
            break

    return None

def _handle_no_run_dir(current_directory):
    """Handle the situation where no run directory could be found."""
    if '-h' in sys.argv or '--help' in sys.argv:
        Logs.warn('No wscript file found: the help message may be incomplete')
        Context.run_dir = current_directory
        ctx = Context.create_context('options')
        ctx.curdir = current_directory
        ctx.parse_args()
        sys.exit(0)
    Logs.error('Waf: Run from a directory containing a file named %r' %
               Context.WSCRIPT_FILE)
    sys.exit(1)

# --------------------------------------------------------------------
# Main entry point
# --------------------------------------------------------------------

def waf_entry_point(current_directory, version, wafdir):
    """Entry point for the Waf build system."""
    Logs.init_log()

    # 1. Version check
    _check_version(version)

    # 2. Handle '--version' flag early
    if '--version' in sys.argv:
        _handle_version_flag(current_directory)

    # 3. Set up context directories
    Context.waf_dir = wafdir
    Context.launch_dir = current_directory

    # 4. Determine whether to stop climbing
    no_climb = _determine_no_climb()

    # 5. Find the run directory
    run_dir = _find_run_dir(current_directory, no_climb)
    if not run_dir:
        _handle_no_run_dir(current_directory)

    # 6. Change to the run directory
    try:
        os.chdir(Context.run_dir)
    except OSError:
        Logs.error('Waf: The folder %r is unreadable' % Context.run_dir)
        sys.exit(1)

    # 7. Load the wscript module
    try:
        set_main_module(Context.run_dir + os.sep + Context.WSCRIPT_FILE)
    except Errors.WafError as e:
        Logs.pprint('RED', e.verbose_msg)
        Logs.error(str(e))
        sys.exit(1)
    except Exception as e:
        Logs.error('Waf: The wscript in %r is unreadable' % Context.run_dir, e)
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)

    # 8. Run the requested commands
    try:
        run_commands()
    except Errors.WafError as e:
        if Logs.verbose > 1:
            Logs.pprint('RED', e.verbose_msg)
        Logs.error(e.msg)
        sys.exit(1)
    except SystemExit:
        raise
    except Exception as e:
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)
    except KeyboardInterrupt:
        Logs.pprint('RED', 'Interrupted')
        sys.exit(68)

# --------------------------------------------------------------------
# Remaining original code (unchanged)
# --------------------------------------------------------------------

def set_main_module(file_path):
    Context.g_module = Context.load_module(file_path)
    Context.g_module.root_path = file_path
    def set_def(obj):
        name = obj.__name__
        if not name in Context.g_module.__dict__:
            setattr(Context.g_module, name, obj)
    for k in [update, dist, distclean, distcheck, update]:
        set_def(k)
    if not 'init' in Context.g_module.__dict__:
        Context.g_module.init = Utils.nada
    if not 'shutdown' in Context.g_module.__dict__:
        Context.g_module.shutdown = Utils.nada
    if not 'options' in Context.g_module.__dict__:
        Context.g_module.options = Utils.nada

def parse_options():
    Context.create_context('options').execute()
    if not Options.commands:
        Options.commands = [default_cmd]
    Options.commands = [x for x in Options.commands if x != 'options']
    Logs.verbose = Options.options.verbose
    Logs.init_log()
    if Options.options.zones:
        Logs.zones = Options.options.zones.split(',')
        if not Logs.verbose:
            Logs.verbose = 1
    elif Logs.verbose > 0:
        Logs.zones = ['runner']
    if Logs.verbose > 2:
        Logs.zones = ['*']

def run_command(cmd_name):
    ctx = Context.create_context(cmd_name)
    ctx.log_timer = Utils.Timer()
    ctx.options = Options.options
    ctx.cmd = cmd_name
    ctx.execute()
    return ctx

def run_commands():
    parse_options()
    run_command('init')
    while Options.commands:
        cmd_name = Options.commands.pop(0)
        ctx = run_command(cmd_name)
        Logs.info('%r finished successfully (%s)' % (cmd_name, str(ctx.log_timer)))
    run_command('shutdown')

def _can_distclean(name):
    for k in '.o .moc .exe'.split():
        if name.endswith(k):
            return True
    return False

def distclean_dir(dirname):
    for (root, dirs, files) in os.walk(dirname):
        for f in files:
            if _can_distclean(f):
                fname = root + os.sep + f
                try:
                    os.unlink(fname)
                except OSError:
